import React, {useEffect} from 'react';
import {UserStore} from "@entities/user";
import {userLogout} from "@entities/session";

export const PersonalPage = () => {
    const user = UserStore.useUser();

    useEffect(() => {
        UserStore.getMe();
    }, []);

    const onClick = async () => {
        await userLogout();
    };

    const getUsers = async () => {
        // const response = await UserStore.getAll();
    }

    return (
        <div>
            <p>Ваш логин: {user.username}</p>
            <button onClick={onClick}>Выход</button>
            <button onClick={getUsers}>Пользователи</button>
        </div>
    );
};
